import React, { useState } from 'react';
import Faker from 'faker';

const ProfileView = () => {
   const [avatar, setAvatar] = useState(Faker.internet.avatar);p
   return (
      <div>
         <h1>My Profile</h1>
         <div>
            <img src={Faker.internet.avatar} />
            <div></div>
         </div>
      </div>
   );
};

export default ProfileView;
